import ComA from './comA';


const FatherName = createContext();
const LastName = createContext();

const App = () => {

   return (
      <>
      <FatherName.Provider value={"Gopal"}>
      <LastName.Provider value={"Patil"}>
       <ComA /> 
       </LastName.Provider>
       </FatherName.Provider>
   </>
   );
};

export default App;
export { FatherName };
export { LastName };
